import React, { useEffect, useState } from 'react';
import { Table, TableBody, TableCell, TableHead, TableRow, Typography } from '@mui/material';
import ABTestService from '../../services/api';
import { CampaignResultResponse } from '../../services/types';

const CampaignResults: React.FC = () => {
  const [resultData, setResultData] = useState<CampaignResultResponse[]>([]);

  useEffect(() => {
    const fetchResults = async () => {
      try {
        const response = await ABTestService.getAllCampaignResults();
        if (Array.isArray(response)) {
          setResultData(response);
        } else {
          setResultData([response]);
        }
      } catch (error) {
        console.error('Error fetching campaign results:', error);
      }
    };

    fetchResults();
    const interval = setInterval(fetchResults, 15000);
    return () => clearInterval(interval);
  }, []);

  const formatTime = (seconds: number) => {
    const days = Math.floor(seconds / (24 * 60 * 60));
    const hours = Math.floor(seconds % (24 * 60 * 60) / (60 * 60));
    const minutes = Math.floor(seconds % (60 * 60) / 60);
    const secs = Math.floor(seconds % 60);

    let timeString = `${secs} seconds`;
    if (days > 0) timeString = `${days} days ${hours} hours ${minutes} minutes ${secs} seconds`;
    else if (hours > 0) timeString = `${hours} hours ${minutes} minutes ${secs} seconds`;
    else if (minutes > 0) timeString = `${minutes} minutes ${secs} seconds`;

    return timeString;
  }


  const renderTableHeader = () => (
    <TableHead>
      <TableRow>
        <TableCell>Campaign Name</TableCell>
        <TableCell>Date Created</TableCell>
        <TableCell>Analysis Time</TableCell>
        <TableCell>Status</TableCell>
        <TableCell>Winner</TableCell>
      </TableRow>
    </TableHead>
  );

  const renderTableBody = () => (
    <TableBody>
      {resultData.map((result) => (
        <TableRow key={result.campaign_id}>
          <TableCell>{result.campaign_name}</TableCell>
          <TableCell>{result.date_created}</TableCell>
          <TableCell>{formatTime(result.analysis_time)}</TableCell>
          <TableCell>{result.status}</TableCell>
          <TableCell>{result.winner}</TableCell>
        </TableRow>
      ))}
    </TableBody>
  );

  const renderMetricsTable = (result: CampaignResultResponse) => {
    const { campaign_name, confidence_interval_lower, confidence_interval_upper, winner, analysis_time, status, control, variants } = result;
    return (
      <div style={{ marginBottom: '20px' }} key={result.campaign_id}>
        <Typography variant="h6">Campaign Name: {campaign_name}</Typography>
        <Typography variant="body1">Confidence Interval: {confi}</Typography>
        <Typography variant="body1">Winner: {winner}</Typography>
        <Typography variant="body1">Analysis Time: {formatTime(analysis_time)}</Typography>
        <Typography variant="body1">Status: {status}</Typography>
        <Typography variant="h6">Control:</Typography>
        <Table style={{ width: '100%', marginBottom: '20px' }}>
          <TableHead>
            <TableRow>
              <TableCell>Name</TableCell>
              <TableCell>Total Views</TableCell>
              <TableCell>Total Clicks</TableCell>
              <TableCell>Click Through Rate</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            <TableRow>
              <TableCell>{control.name}</TableCell>
              <TableCell>{control.total_views}</TableCell>
              <TableCell>{control.total_clicks}</TableCell> {/* Display Total Clicks */}
              <TableCell>{control.ctr.toPrecision(2)}%</TableCell>
            </TableRow>
          </TableBody>
        </Table>
        <Typography variant="h6">Variants:</Typography>
        <Table style={{ width: '100%', marginBottom: '20px' }}>
          <TableHead>
            <TableRow>
              <TableCell>Name</TableCell>
              <TableCell>Total Views</TableCell>
              <TableCell>Total Clicks</TableCell>
              <TableCell>Click Through Rate</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {variants.map((variant, index) => (
              <TableRow key={index}>
                <TableCell>{variant.name}</TableCell>
                <TableCell>{variant.total_views}</TableCell>
                <TableCell>{variant.total_clicks}</TableCell> {/* Display Total Clicks */}
                <TableCell>{variant.ctr.toPrecision(2)}%</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </div>
    );
  };

  return (
    <div>
      <Typography variant="h4">Campaign Results</Typography>
      <Table>
        {renderTableHeader()}
        {renderTableBody()}
      </Table>
      {resultData.length > 0 && resultData.map(result => renderMetricsTable(result))}
    </div>
  );
};

export default CampaignResults;
